	<script id="vshader129" type="x-shader/x-vertex">
	attribute vec3 aPos;
	attribute vec4 aCol;
	uniform mat4 mvMatrix;
	uniform mat4 prMatrix;
	varying vec4 vCol;
	varying vec4 vPosition;
	void main(void) {
	  vPosition = mvMatrix * vec4(aPos, 1.);
	  gl_Position = prMatrix * vPosition;
	  gl_PointSize = 3.;
	  vCol = aCol;
	}
	</script>

	<script id="fshader129" type="x-shader/x-fragment"> 
	#ifdef GL_ES
	precision highp float;
	#endif
	varying vec4 vCol; // carries alpha
	varying vec4 vPosition;
	void main(void) {
      vec4 colDiff = vCol;
	  vec4 lighteffect = colDiff;
	  gl_FragColor = lighteffect;
	}
	</script> 

	<!-- ****** text object 131 ****** -->
	<script id="vshader131" type="x-shader/x-vertex">
	attribute vec3 aPos;
	attribute vec4 aCol;
	uniform mat4 mvMatrix;
	uniform mat4 prMatrix;
	varying vec4 vCol;
	varying vec4 vPosition;
	attribute vec2 aTexcoord;
	varying vec2 vTexcoord;
	uniform vec2 textScale;
	attribute vec2 aOfs;
	void main(void) {
	  vCol = aCol;
	  vTexcoord = aTexcoord;
	  vec4 pos = prMatrix * mvMatrix * vec4(aPos, 1.);
	  pos = pos/pos.w;
	  gl_Position = pos + vec4(aOfs*textScale, 0.,0.);
	}
	</script>

	<script id="fshader131" type="x-shader/x-fragment"> 
	#ifdef GL_ES
	precision highp float;
	#endif
	varying vec4 vCol; // carries alpha
	varying vec4 vPosition;
	varying vec2 vTexcoord;
	uniform sampler2D uSampler;
	void main(void) {
      vec4 colDiff = vCol;
	  vec4 lighteffect = colDiff;
	  vec4 textureColor = lighteffect*texture2D(uSampler, vTexcoord);
	  if (textureColor.a < 0.1)
	    discard;
	  else
	    gl_FragColor = textureColor;
	}
	</script>

	(function() {
	  this.getShader = function( gl, id ){
	    var shaderScript = document.getElementById ( id );
	    var str = "";
	    var k = shaderScript.firstChild;
	    while ( k ){
	      if ( k.nodeType == 3 ) str += k.textContent;
	      k = k.nextSibling;
	    }
	    var shader;
	    if ( shaderScript.type == "x-shader/x-fragment" )
	      shader = gl.createShader ( gl.FRAGMENT_SHADER );
	    else if ( shaderScript.type == "x-shader/x-vertex" )
	      shader = gl.createShader(gl.VERTEX_SHADER);
	    else return null;
	    gl.shaderSource(shader, str);
	    gl.compileShader(shader);
	    if (gl.getShaderParameter(shader, gl.COMPILE_STATUS) == 0)
	      alert(gl.getShaderInfoLog(shader));
	    return shader;
	  }
	  this.multMV = function(M, v) {
	     return [M.m11*v[0] + M.m12*v[1] + M.m13*v[2] + M.m14*v[3],

		     M.m31*v[0] + M.m32*v[1] + M.m33*v[2] + M.m34*v[3],

	  }

	  this.f_is_smooth = 2;
	  this.f_has_texture = 4;
	  this.f_is_indexed = 8;
	  this.f_depth_sort = 16;
	  this.f_fixed_quads = 32;
	  this.f_is_transparent = 64;
	  this.f_is_lines = 128;
	  this.f_sprites_3d = 256;
	  this.f_sprite_3d = 512;
	  this.f_is_subscene = 1024;
	  this.f_is_clipplanes = 2048;
	  this.f_reuse = 4096;
	  this.whichList = function(id) {
	    if (this.flags[id] & this.f_is_subscene)
	      return "subscenes";
	    else if (this.flags[id] & this.f_is_clipplanes)
	      return "clipplanes";
	    else if (this.flags[id] & this.f_is_transparent)
	      return "transparent";
	    else
	      return "opaque"; 
          }
	  this.inSubscene = function(id, subscene) {
	    var thelist = this.whichList(id);
	    return this[thelist][subscene].indexOf(id) > -1;
	  }
          this.addToSubscene = function(id, subscene) {
            var thelist = this.whichList(id);
	    if (this[thelist][subscene].indexOf(id) == -1)
	      this[thelist][subscene].push(id);
	  }
	  this.delFromSubscene = function(id, subscene) {
	    var thelist = this.whichList(id);
	    var i = this[thelist][subscene].indexOf(id);
	    if (i > -1)
	      this[thelist][subscene].splice(i, 1);
	  }
	  this.setSubsceneEntries = function(ids, subscene) {
	    this.subscenes[subscene] = [];
	    this.clipplanes[subscene] = [];
	    this.transparent[subscene] = [];
	    this.opaque[subscene] = [];
	    for (var i = 0; i < ids.length; i++)
	      this.addToSubscene(ids[i], subscene);
	  }
	  this.getSubsceneEntries = function(subscene) {
	    return(this.subscenes[subscene].concat(this.clipplanes[subscene]).
                   concat(this.transparent[subscene]).concat(this.opaque[subscene]));
	  }
    }).call(rglClass.prototype);

	   function getPowerOfTwo(value) {
	     var pow = 1;
	     while(pow<value) {
	       pow *= 2;
	     }
	     return pow;
	   }

	   function handleLoadedTexture(texture, textureCanvas) {
	     gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);

	     gl.bindTexture(gl.TEXTURE_2D, texture);
	     gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, textureCanvas);
	     gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
	     gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR_MIPMAP_NEAREST);
	     gl.generateMipmap(gl.TEXTURE_2D);

	     gl.bindTexture(gl.TEXTURE_2D, null);
	   }
	   
	   function loadImageToTexture(filename, texture) {   
	     var canvas = document.getElementById("textureCanvas");
	     var ctx = canvas.getContext("2d");
	     var image = new Image();
	     
	     image.onload = function() {
	       var w = image.width;
	       var h = image.height;
	       var canvasX = getPowerOfTwo(w);
	       var canvasY = getPowerOfTwo(h);
	       canvas.width = canvasX;
	       canvas.height = canvasY;
	       ctx.imageSmoothingEnabled = true;
	       ctx.drawImage(image, 0, 0, canvasX, canvasY);
	       handleLoadedTexture(texture, canvas);
	       rgl.drawScene();
	     }
	     image.src = filename;
	   }  	   

	   function drawTextToCanvas(text, cex) {
	     var canvasX, canvasY;
	     var textX, textY;

	     var textHeight = 20 * cex;
	     var textColour = "white";
	     var fontFamily = "Arial";

	     var backgroundColour = "rgba(0,0,0,0)";

	     var canvas = document.getElementById("textureCanvas");
	     var ctx = canvas.getContext("2d");

	     ctx.font = textHeight+"px "+fontFamily;

	     canvasX = 1;
	     var widths = [];
	     for (var i = 0; i < text.length; i++)  {
	       widths[i] = ctx.measureText(text[i]).width;
	       canvasX = (widths[i] > canvasX) ? widths[i] : canvasX;
	     }	  
	     canvasX = getPowerOfTwo(canvasX);

	     var offset = 2*textHeight; // offset to first baseline
	     var skip = 2*textHeight;   // skip between baselines	  
	     canvasY = getPowerOfTwo(offset + text.length*skip);
	     
	     canvas.width = canvasX;
	     canvas.height = canvasY;

	     ctx.fillStyle = backgroundColour;
	     ctx.fillRect(0, 0, ctx.canvas.width, ctx.canvas.height);

	     ctx.fillStyle = textColour;
	     ctx.textAlign = "left";

	     ctx.textBaseline = "alphabetic";
	     ctx.font = textHeight+"px "+fontFamily;

	     for(var i = 0; i < text.length; i++) {
	       textY = i*skip + offset;
	       ctx.fillText(text[i], 0,  textY);
	     }
	     return {canvasX:canvasX, canvasY:canvasY,
	             widths:widths, textHeight:textHeight,
	             offset:offset, skip:skip};
